  //     </article>
  //   );
  // });
  return (
    <JobCardsLayout title="Entry-level Jobs">
      {/* {data.map((res, index) => {
        const { job_position, company, location, url } = res;
        <articleLayout uniqueKey={index}>
          <h1>{job_position}</h1>
          <h1>{company}</h1>
          <h1>{location}</h1>
        </articleLayout>;
      })} */}
      <h1>Hello</h1>
    </JobCardsLayout>
  );
}
